About the show:

Whale Wars is a one-hour weekly American reality television series on Animal Planet. The program follows Paul Watson, founder of the Sea Shepherd Conservation Society, as he and his crew aboard the MV Steve Irwin attempt to deter Japanese ships that hunt minke and fin whales in the Southern Ocean Whale Sanctuary in the name of research.

